description:
Ламинированная фанера - это высококачественная берёзовая фанера ФСФ, покрытая специальной бумагой, пропитанной фенолформальдегидными смолами, которая в процессе производства приобретает свойства защитной плёнки. Применяется в монолитном строительстве; производстве мебели;
отделке и оформлении интерьера;
промышленности; машиностроении;
изготовлении кейсов и кофров и т.д.
Основное достоинство ФОБ — это высокая устойчивость к влаге, что обеспечивает материалу продолжительный срок службы, несмотря на самые суровые условия эксплуатации.

